import React from 'react'
import { 
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom'

const styles = {
    backgroundColor : '#114',
    color : 'white',
    margin : 'auto',
    padding : '10px',
    position : 'fix'
}

const NavBar = props => {
    const navItems = [
        {
            title : 'Home',
            to : '/'
        },
        {
            title : 'About',
            to : '/about'
        },
        {
            title : 'Portfolio',
            to : '/Portfolio'
        }
    ]
    return (
        <Router>
            <div style={styles}>
                <h1>Motorcyclers Schedule</h1>
                <ul>
                    {navItems.map(navItem => (
                        <li>
                            <Link to={navItem.to}>{navItem.title}</Link>
                        </li>
                    ))}
                </ul>
            </div>
        </Router>
    )
}

const NavItem = props => {
    return <li>{props.title}</li>
}

export default NavBar
